    constructor(props){
        super(props);
        this.state = {

        };
    }

    render(){
        return (
            <Router>
                <div>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/login">Login</Link>
                        </li>
                    </ul>

                    <Switch>
                        <Route exact path="/">
